export default function UserDynamiqueTab(props) {
    return (
        <tr>
            <td>{props.year}</td>
            <td>{props.expected}</td>
            <td>{props.current}</td>
            <td>{props.investment}</td>
            <td>TOTAL INVESTED CAPITAL</td>
        </tr>
    )
}
